import React from 'react';

const Category = () => {
  return (
    <div>
      <header>CATEGORIES</header>
      <div>
        <span>APPLE</span>
        <button>All</button>
      </div>
      <div>
        <span>IPHONE & MAC</span>
        <button>Iphone</button>
        <button>Ipad</button>
        <button>Macbook</button>
      </div>
      <span>WIRELESS</span>
      <button>Airpod</button>
      <button>Watch</button>
      <span>OTHER</span>
      <button>Mouse</button>
      <button>Keyboard</button>
      <button>Other</button>
    </div>
  );
};

export default Category;
